import React from 'react';
import ios from '../images/ios.svg';
import android from '../images/android.svg';

function Download() {

    const iOSUrl = 'https://apps.apple.com/us/app/trodo/id1590261061';
    const androidUrl = 'https://play.google.com/store/apps/details?id=info.trodo.trodo';

    return (
        <div id='download'>
            <h3>Download the future of productivity</h3>
            <div className='a-container'>
                <div className='a-box'>
                    <div className='qr-img'>
                        <img src={ios} />
                    </div>
                    <a href='#' className='cv-btn'>Download Now</a>
                </div>
                <div className="ios-button">

                </div>

                <div className='a-box'>
                    <div className='qr-img'>
                        <img src={android} />
                    </div>
                    <a href='#' className='cv-btn'>Download Now</a>
                </div>
                <div className="android-button">

                </div>
            </div>
        </div>
    )
}

export default Download;
